const totals={'First Year':{'1st Semester':{'lecture':19,'lab':3,'credit_units':22},'2nd Semester':{'lecture':22,'lab':2,'credit_units':24},'3rd Semester':{'lecture':0,'lab':0,'credit_units':0}},'Second Year':{'1st Semester':{'lecture':17,'lab':3,'credit_units':20},'2nd Semester':{'lecture':19,'lab':5,'credit_units':24},'3rd Semester':{'lecture':0,'lab':0,'credit_units':0}},'Third Year':{'1st Semester':{'lecture':15,'lab':3,'credit_units':18},'2nd Semester':{'lecture':14,'lab':4,'credit_units':18},'3rd Semester':{'lecture':0,'lab':0,'credit_units':0}},'Fourth Year':{'1st Semester':{'lecture':14,'lab':4,'credit_units':18},'2nd Semester':{'lecture':8,'lab':1,'credit_units':9},'3rd Semester':{'lecture':0,'lab':0,'credit_units':0}}};document.addEventListener("DOMContentLoaded",function(){for(const[year,semesters]of Object.entries(totals)){for(const[semester,details]of Object.entries(semesters)){document.getElementById(`lecture-${year}-${semester}`).innerText=details.lecture;document.getElementById(`lab-${year}-${semester}`).innerText=details.lab;document.getElementById(`credit_units-${year}-${semester}`).innerText=details.credit_units;}}});;